const Sidebar = () => {
    return (
        <>
<Box sx={{minHeight:"90vh",border:2,borderColor:"grey.900",py:2}}>

    <Typography variant="h6" align="LEFT" sx={{fontWeight:"bold"}}>PENDING REQUESTS</Typography>

     <Notification icon={<NotificationsActiveOutlined/>} details="Meeting with Stylist" time="9:40" date="Due soon" />

     <Notification icon={<FileUploadOutlined/>} details="Upload Requested Document" time="10:40" date="Feb 2022" />  

     <Notification icon={<FileUploadOutlined/>} details="Invoice Due" time="12:40" date="Jan 2022" /> 
</Box>

        </>
    )
}

export default Sidebar;
